import React, { useState, useCallback } from 'react';
import ReactFlow, {
  ReactFlowProvider,
  addEdge,
  Background,
  Controls,
  MiniMap,
  Handle,
} from 'react-flow-renderer';
import { v4 as uuidv4 } from 'uuid';

const initialNodes = [
  {
    id: '1',
    type: 'default',
    data: { label: 'Start Node: Hello! Do you want to continue? (Yes/No)' },
    position: { x: 250, y: 5 },
  },
];

const initialEdges = [];

const nodeTypes = {
  customNode: ({ data }) => {
    return (
      <div style={{ padding: 10, border: '1px solid #888', borderRadius: 5, background: '#f0f0f0', minWidth: 200 }}>
        <strong>Node ID: {data.id}</strong>
        <br />
        <textarea
          rows={4}
          style={{ width: '100%' }}
          value={data.message}
          onChange={(e) => data.onChange('message', e.target.value)}
          placeholder="Node message..."
        />
        <input
          style={{ width: '100%', marginTop: 4 }}
          placeholder="Expected inputs (comma-separated)"
          value={data.expected_inputs || ''}
          onChange={(e) => data.onChange('expected_inputs', e.target.value)}
        />
        <input
          style={{ width: '100%', marginTop: 4 }}
          placeholder="Options (yes:2,no:3)"
          value={data.options || ''}
          onChange={(e) => data.onChange('options', e.target.value)}
        />
        <input
          style={{ width: '100%', marginTop: 4 }}
          placeholder="Capture (name, age, etc.)"
          value={data.capture || ''}
          onChange={(e) => data.onChange('capture', e.target.value)}
        />
        <input
          style={{ width: '100%', marginTop: 4 }}
          placeholder="Next node ID"
          value={data.next || ''}
          onChange={(e) => data.onChange('next', e.target.value)}
        />
        <input
          style={{ width: '100%', marginTop: 4 }}
          placeholder="Follow-up prompt (optional)"
          value={data.follow_up_prompt || ''}
          onChange={(e) => data.onChange('follow_up_prompt', e.target.value)}
        />
        <input
          style={{ width: '100%', marginTop: 4 }}
          placeholder="Follow-up capture"
          value={data.follow_up_capture || ''}
          onChange={(e) => data.onChange('follow_up_capture', e.target.value)}
        />
        <label style={{ marginTop: 4 }}>
          <input
            type="checkbox"
            checked={data.gpt?.enabled || false}
            onChange={(e) => data.onChange('gpt', { enabled: e.target.checked })}
          /> GPT Enabled
        </label>
        <label>
          <input
            type="checkbox"
            checked={data.end || false}
            onChange={(e) => data.onChange('end', e.target.checked)}
          /> End Node
        </label>
        <Handle type="source" position="right" />
        <Handle type="target" position="left" />
      </div>
    );
  },
};

function App() {
  const [nodes, setNodes] = useState(initialNodes);
  const [edges, setEdges] = useState(initialEdges);

  const updateNodeData = useCallback((id, field, value) => {
    setNodes((nds) =>
      nds.map((node) => {
        if (node.id === id) {
          const newData = { ...node.data, [field]: value };
          return {
            ...node,
            data: {
              ...newData,
              id,
              onChange: (f, v) => updateNodeData(id, f, v),
            },
          };
        }
        return node;
      })
    );
  }, []);

  const addNode = () => {
    const id = uuidv4();
    setNodes((nds) => [
      ...nds,
      {
        id,
        type: 'customNode',
        position: { x: Math.random() * 400, y: Math.random() * 400 },
        data: {
          id,
          message: '',
          onChange: (field, value) => updateNodeData(id, field, value),
        },
      },
    ]);
  };

  const onConnect = (params) => setEdges((eds) => addEdge(params, eds));

  const exportJSON = () => {
    const result = {
      settings: {
        default_gpt_model: 'gpt-3.5-turbo',
        default_system_prompt: '[SEE YOUR JSON ABOVE]',
        context_includes: ['history', 'user_state', 'problems'],
      },
      variables: {
        name: '',
        first_name: '',
        email: '',
        age: '',
        problem_type: '',
        problem_details: '',
        intensity: '',
        problems: [],
      },
      nodes: {},
    };

    nodes.forEach((node) => {
      const d = node.data;
      const nodeObj = {
        message: d.message || '',
      };
      if (d.options) {
        try {
          const parts = d.options.split(',').map((p) => p.split(':').map((s) => s.trim()));
          nodeObj.options = Object.fromEntries(parts);
        } catch (e) {
          console.warn(`Error parsing options: ${d.options}`);
        }
      }
      if (d.expected_inputs) nodeObj.expected_inputs = d.expected_inputs.split(',').map((v) => v.trim());
      if (d.capture) nodeObj.capture = d.capture;
      if (d.next) nodeObj.next = d.next;
      if (d.follow_up_prompt) nodeObj.follow_up_prompt = d.follow_up_prompt;
      if (d.follow_up_capture) nodeObj.follow_up_capture = d.follow_up_capture;
      if (d.gpt?.enabled) nodeObj.gpt = { enabled: true };
      if (d.end) nodeObj.end = true;

      result.nodes[node.id] = nodeObj;
    });

    const json = JSON.stringify(result, null, 2);
    const blob = new Blob([json], { type: 'application/json' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = 'conversation_data.json';
    a.click();
    URL.revokeObjectURL(url);
  };

  return (
    <div style={{ height: '100vh', display: 'flex' }}>
      <ReactFlowProvider>
        <div style={{ flexGrow: 1 }}>
          <ReactFlow
            nodes={nodes.map((n) => ({
              ...n,
              type: 'customNode',
              data: {
                ...n.data,
                onChange: (field, value) => updateNodeData(n.id, field, value),
              },
            }))}
            edges={edges}
            onNodesChange={setNodes}
            onEdgesChange={setEdges}
            onConnect={onConnect}
            nodeTypes={nodeTypes}
            fitView
          >
            <MiniMap />
            <Controls />
            <Background />
          </ReactFlow>
        </div>
        <div style={{ width: 300, padding: 10, borderLeft: '1px solid #ccc', background: '#f9f9f9' }}>
          <button onClick={addNode} style={{ width: '100%', marginBottom: 10 }}>
            ➕ Add Node
          </button>
          <button onClick={exportJSON} style={{ width: '100%' }}>
            📦 Export JSON
          </button>
        </div>
      </ReactFlowProvider>
    </div>
  );
}

export default App;
